export default function App() {
  const Stack = createStackNavigator();
  const navigatorRenderScene = (route, navigator)=>{
    switch(route.id){
      case 'page1':
        return(<Items navigator={navigator}/>)
    }
  }
  return (
    <Navigator initialRoute = {{id:'page1'}}
    renderScene = {navigatorRenderScene} />

